<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width,initial-scale=1.0">
    <link rel="icon" href="<%= BASE_URL %>assets/favicon.png">
     <!-- plugins:css -->
     <link rel="stylesheet" href="<%= BASE_URL %>assets/vendors/mdi/css/materialdesignicons.min.css">
     <link rel="stylesheet" href="<%= BASE_URL %>assets/vendors/css/vendor.bundle.base.css">
     <!-- endinject -->
     <link rel="stylesheet" href="<%= BASE_URL %>assets/css/style.css">
     <link href="https://fonts.googleapis.com/css2?family=Asap+Condensed:ital@1&family=Open+Sans:ital,wght@0,400;0,600;1,400&family=Oswald&display=swap" rel="stylesheet">
     <link href="https://fonts.googleapis.com/css2?family=Markazi+Text:wght@500&display=swap" rel="stylesheet">
     <link href="https://fonts.googleapis.com/css2?family=Saira:wght@500&display=swap" rel="stylesheet">
     

    <title><%= htmlWebpackPlugin.options.title %></title>
    
  </head>
  <body>
    <noscript>
      <strong>We're sorry but <%= htmlWebpackPlugin.options.title %> doesn't work properly without JavaScript enabled. Please enable it to continue.</strong>
    </noscript>
    <div id="app"></div>
    <!-- built files will be auto injected -->

     <!-- plugins:js -->
     <script src="<%= BASE_URL %>assets/vendors/js/vendor.bundle.base.js"></script>
     <!-- endinject -->
     <!-- Plugin js for this page -->
     <script src="<%= BASE_URL %>assets/vendors/chart.js/Chart.min.js"></script>
     <!-- End plugin js for this page -->
     <!-- inject:js -->
     <script src="assets/js/off-canvas.js"></script>
     <script src="<%= BASE_URL %>assets/js/off-canvas.js"></script>
     <script src="<%= BASE_URL %>assets/js/hoverable-collapse.js"></script>
     <script src="<%= BASE_URL %>assets/js/misc.js"></script>
     <!-- endinject -->

     
  </body>
</html>
